      this.path, 
      this.perPage, 
      this.prevPageUrl, 
      this.to, 
      this.total});

  ProviderTimeData.fromJson(dynamic json) {
    currentPage = json["current_page"];
    if (json["data"] != null) {
      providerTimeslotsData = [];
      json["data"].forEach((v) {
        providerTimeslotsData.add(ProviderTimeslotsData.fromJson(v));
      });
    }
    firstPageUrl = json["first_page_url"];
    from = json["from"];
    lastPage = json["last_page"];
    lastPageUrl = json["last_page_url"];
    nextPageUrl = json["next_page_url"];
    path = json["path"];
    perPage = json["per_page"];
    prevPageUrl = json["prev_page_url"];
    to = json["to"];
    total = json["total"];
  }

